package main

import (
	"fmt"
	"sort"
)

func permutation(s string) []string {
	t := []byte(s)
	sort.Slice(t, func(i, j int) bool {
		return t[i] < t[j]
	})

	//fmt.Println(string(t))
	s = string(t)
	//fmt.Println(s)
	var hash = map[int]bool{}
	var temp string
	var ans []string
	var dfs func()
	dfs = func() {
		if len(temp) == len(s) {
			ans = append(ans, temp)
		}
		for i := 0; i < len(s); i++ {

			if hash[i] || (i > 0 && !hash[i-1] && s[i] == s[i-1]) {
				continue
			}
			temp += string(s[i])
			hash[i] = true
			dfs()
			temp = temp[:len(temp)-1]
			hash[i] = false
		}
	}
	dfs()
	return ans
}
